import React from "react";
import Fade from "react-reveal/Fade";
import {
  faMemory,
  faCogs,
  faBrain,
  faDiceD20,
  faLaptopCode,
  faToolbox,
  faDownload,
} from "@fortawesome/free-solid-svg-icons";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import ReactGA from "react-ga";
import Button from "@material-ui/core/Button";
import SkillCard from "./cards/SkillCard";
import "../static/css/Skills.css";

export default function Skills() {
  return (
    <div className="section skills">
      <h2 className="section-heading">Skills</h2>
      <Fade bottom cascade>
        <div className="skills-grid">
          <SkillCard
            skillInfo={{
              name: "Front-End Development",
              icon: faDiceD20,
              color: "#fff",
              details:
                "Any concept to a responsive user interface with latest tools and technologies",
            }}
          />
          <SkillCard
            skillInfo={{
              name: "Back-End Development",
              icon: faBrain,
              color: "#fff",
              details:
                "Scalable server background services and API development as per application need.",
            }}
          />

          <SkillCard
            skillInfo={{
              name: "Mobile Application Development",
              icon: faMemory,
              color: "#fff",
              details:
                "Optimized cross plateform applications using Flutter for personal and commercial purpose. ",
            }}
          />

          <SkillCard
            skillInfo={{
              name: "Web Development",
              icon: faLaptopCode,
              color: "#fff",
              details:
                "HTML5, CSS3, Javascript, Bootstrap, jQuery, AJAX, React, Django, NodeJS",
            }}
          />
          <SkillCard
            skillInfo={{
              name: "Software Engineering",
              icon: faCogs,
              color: "#fff",
              details:
                "API Design, Object-Oriented Design, Human-centered Software, Cloud Computing",
            }}
          />
          <SkillCard
            skillInfo={{
              name: "Tools and Languages",
              icon: faToolbox,
              color: "#fff",
              details:
                "C/C++, Python, Java, Golang, Bash, SQL, Git, OpenCV, MATLAB, Arduino",
            }}
          />
        </div>

        <div className="more-projects">
          <ReactGA.OutboundLink
            eventLabel="Resume"
            to="/resume.pdf"
            target="_blank"
            rel="noopener noreferrer"
          >
            <Button className="section-button">
              <FontAwesomeIcon className="more-icon" icon={faDownload} />
              Resume
            </Button>
          </ReactGA.OutboundLink>
        </div>
      </Fade>
    </div>
  );
}
